const formatTime = date => {
  const year = date.getFullYear()
  const month = date.getMonth() + 1
  const day = date.getDate()
  const hour = date.getHours()
  const minute = date.getMinutes()
  const second = date.getSeconds()

  return [year, month, day].map(formatNumber).join('/') + ' ' + [hour, minute, second].map(formatNumber).join(':')
}

const formatNumber = n => {
  n = n.toString()
  return n[1] ? n : '0' + n
}


const parseIdCard = (idCard) => {
  if (! /^[0-9]{17}[0-9,'X','x']$/.test(idCard)) {
    return {};
  }
  let user = { idCard };
  let sex = idCard[16];
  user.sex = (sex % 2 != 0);
  user.birth_year = idCard.substring(6, 10);
  user.birth_month = idCard.substring(10, 12);
  user.birth_day = idCard.substring(12, 14);
  let v1 = idCard.substring(0, 2);
  let v2 = idCard.substring(2, 4);
  let v3 = idCard.substring(4, 6);
  user.address = (CITY_CODE[v1].title || "") + (CITY_CODE[v1].data[v2].title || "") + (CITY_CODE[v1].data[v2].data[v3].title || "");
  return user;
}
const age = (date) => {
  let now = new Date();
  let age = now.getFullYear() - date.getFullYear();
  let t1, t2;
  t1 = date.getMonth();
  t2 = now.getMonth();
  if (t2 > t1) return age;
  if (t2 < t1) return age - 1;
  t1 = date.getDate();
  t2 = now.getDate();
  if (t2 >= t1) {//生日这天认为已经满周岁了
    return age;
  }
  return age - 1;
}

const age2 = (date) => {
  // date = new Date("2019-2-1")
  var d1 = Calendar.solarToLunar(date.getFullYear(), date.getMonth()+1,date.getDate());
  date = new Date();
  var d2 = Calendar.solarToLunar(date.getFullYear(), date.getMonth() + 1, date.getDate());
  console.log(d1.lunarYear, d2.lunarYear);
  //虚岁计算
  return d2.lunarYear - d1.lunarYear+1;
}

module.exports = {
  formatTime: formatTime,
  parseIdCard,
  age,age2
}
